A Little Holiday Glam ✨ + a little encouragement message :
I find doing makeup therapeutic , I always have . It has such significant value below the surface for me . In many ways, the art of doing makeup on faces is something I feel chose me . It was innatte , it was natural and brings a sense of peace in my life . My advice is to lean into the things that bring you comfort and joy and do more of those things and see how it can change your life. Many things in my life I’ve hoped I can control. Which with time , I’m learning I can’t … and the things that are TRULY for us , come naturally and easily. Nothing good is ever forced . 🤍🤍

